*
{
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

html,
body
{
    overflow: hidden;
    font-family: 'Arial', sans-serif;
}

body {
    background: linear-gradient(to bottom, #87CEEB 0%, #87CEEB 70%, #90EE90 70%, #90EE90 100%);
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
}

#game-container {
    position: relative;
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
}

#gameCanvas {
    border: 4px solid #333;
    background: linear-gradient(to bottom, #87CEEB 0%, #87CEEB 70%, #90EE90 70%, #90EE90 100%);
    display: block;
    box-shadow: 0 0 20px rgba(0,0,0,0.3);
}

#score {
    position: absolute;
    top: 30px;
    left: 50%;
    transform: translateX(-50%);
    font-size: 48px;
    font-weight: bold;
    color: white;
    text-shadow: 3px 3px 0 #000, -3px -3px 0 #000, 3px -3px 0 #000, -3px 3px 0 #000;
    z-index: 10;
    pointer-events: none;
}

#gameOver {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    background: rgba(0, 0, 0, 0.9);
    padding: 40px 60px;
    border-radius: 20px;
    text-align: center;
    color: white;
    z-index: 20;
    border: 4px solid #FFD700;
}

#gameOver h2 {
    font-size: 48px;
    margin-bottom: 20px;
    color: #FFD700;
}

#gameOver p {
    font-size: 24px;
    margin: 10px 0;
}

#startScreen {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    background: rgba(0, 0, 0, 0.9);
    padding: 40px 60px;
    border-radius: 20px;
    text-align: center;
    color: white;
    z-index: 20;
    border: 4px solid #FFD700;
}

#startScreen h1 {
    font-size: 48px;
    margin-bottom: 20px;
    color: #FFD700;
}

#startScreen p {
    font-size: 24px;
}

.hidden {
    display: none !important;
}

