  ctx.beginPath();
  ctx.arc(-10, -3, 3, 0, Math.PI * 2);
  ctx.arc(10, -3, 3, 0, Math.PI * 2);
  ctx.fill();

  // Draw eye shine
  ctx.fillStyle = '#fff';
  ctx.beginPath();
  ctx.arc(-9, -4, 1.5, 0, Math.PI * 2);
  ctx.arc(11, -4, 1.5, 0, Math.PI * 2);
  ctx.fill();

  // Draw smile
  ctx.strokeStyle = '#000';
  ctx.lineWidth = 2;
  ctx.beginPath();
  ctx.arc(0, 5, 12, 0.2, Math.PI - 0.2);
  ctx.stroke();

  // Draw mustache (stylish)
  ctx.strokeStyle = '#1a1a1a';
  ctx.lineWidth = 3;
  ctx.beginPath();
  ctx.moveTo(-15, 3);
  ctx.quadraticCurveTo(-10, 0, -5, 2);
  ctx.moveTo(15, 3);
  ctx.quadraticCurveTo(10, 0, 5, 2);
  ctx.stroke();

  // Draw sunglasses (cool look)
  ctx.strokeStyle = '#000';
  ctx.lineWidth = 3;
  ctx.fillStyle = 'rgba(0, 0, 0, 0.6)';
  // Left lens
  ctx.beginPath();
  ctx.rect(-18, -8, 12, 8);
  ctx.fill();
  ctx.stroke();
