    const bottomGradient = ctx.createLinearGradient(pipe.x, 0, pipe.x + PIPE_WIDTH, 0);
    bottomGradient.addColorStop(0, '#2ecc71');
    bottomGradient.addColorStop(0.5, '#27ae60');
    bottomGradient.addColorStop(1, '#229954');
